import React from 'react'

const BoxSisu = (props) => {
    box.map(item => {
        return (
            <div
                key={item.id}
                style={{ backgroundColor: item.on ? "green" : "red" }}
                onClick={() => vajuta(item.id)}
            >
                box.{item.id}
            </div>
        );
    });
}

export default BoxSisu
